INSERT INTO `riskcontrol_rule` VALUES (4,'2024-02-27 16:07:51.715000','2024-06-29 14:44:57.796000','0','tfa','if !isNil(CurTfa.PhoneUpdatedAt) {\r\n  if Time.After(CurTfa.PhoneUpdatedAt, Time.NowAdd(Time.Minute * -10)){\r\n    return RiskCode.Forbidden\r\n  }\r\n}\r\nif !isNil(CurTfa.MailUpdatedAt){\r\n  if Time.After(CurTfa.MailUpdatedAt, Time.NowAdd(Time.Minute * -10)){\r\n    return RiskCode.Forbidden\r\n  }\r\n}\r\n/////\r\nif CurTfa.TxNeedVerify {\r\n  return RiskCode.Verify\r\n}\r\nreturn RiskCode.Pass',2,1,'tfa'),(5,'2024-02-27 16:09:29.015000','2024-07-02 16:53:35.295000','0','ft_sum','	chainIds = NumberList.New(Context.ChainId)\r\n	/////\r\n	befor24h = Time.TimeStampBefore(Time.Minute * 10)\r\n\r\n	forRange i := SignTxs {\r\n		SignTx = SignTxs[i]\r\n    Log.Debug(\"tx is:\", SignTx)\r\n		asset = AggDB.AssetAttr(Context.ChainId, SignTx)\r\n    Log.Debug(\"asset is:\", asset)\r\n    if asset.AssetKind != \"erc20\" && asset.AssetKind != \"external\" {\r\n      return RiskCode.Pass\r\n    }\r\n		cnt = AggDB.AssetFtSum(Cfg.AllChainIds, SignTx.From, asset, befor24h)\r\n    Log.Debug(\"has sent\", cnt)\r\n		if asset.Symbol == \"RPG\" {\r\n			if asset.AssetKind == \"erc20\" {\r\n        if cnt + asset.Value > 3 {\r\n				  return RiskCode.Verify\r\n        }\r\n      }else{\r\n        if cnt + asset.Value > 1 {\r\n				  return RiskCode.Verify\r\n        }\r\n      }\r\n    }else if asset.Symbol == \"BNB\"{\r\n			if cnt + asset.Value > 0.02 {\r\n				return RiskCode.Verify\r\n			}\r\n    }else if asset.Symbol == \"MNT\"{\r\n			if cnt + asset.Value > 10 {\r\n				return RiskCode.Verify\r\n			}\r\n    }else if asset.Symbol == \"ETH\"{\r\n			if cnt + asset.Value > 0.1 {\r\n				return RiskCode.Verify\r\n			}\r\n    }else if asset.Symbol == \"USDT\"{\r\n			if cnt + asset.Value > 10 {\r\n				return RiskCode.Verify\r\n			}\r\n		}else if asset.Symbol == \"MUD\"{\r\n			if cnt + asset.Value > 1000 {\r\n				return RiskCode.Verify\r\n			}\r\n		}else if asset.Symbol == \"MIX\"{\r\n			if cnt + asset.Value > 5000  {\r\n				return RiskCode.Verify\r\n			}\r\n	  }\r\n	}\r\n	\r\n	return RiskCode.Pass',100,1,'AssetCnt'),(6,'2024-02-27 16:26:57.958000','2024-07-04 16:56:50.503000','0','nft_cnt','chainIds = NumberList.New(Context.ChainId)\r\n///\r\nbefor24h = Time.TimeStampBefore(Time.Minute * 10)\r\n\r\nforRange i := SignTxs {\r\n  SignTx = SignTxs[i]\r\n  Log.Debug(\"signTx:\", SignTx)\r\n  asset = AggDB.AssetAttr(Context.ChainId, SignTx)\r\n  Log.Debug(\"asset:\", asset)\r\n  if asset.AssetKind != \"erc721\" && asset.AssetKind != \"erc1155\" {\r\n    return RiskCode.Pass\r\n  }\r\n  cnt = AggDB.AssetNftCnt(chainIds, SignTx.From, asset, befor24h)\r\n  Log.Debug(\"has send:\", cnt)\r\n  if asset.Symbol == \"Weapon\" {\r\n    if cnt > 2  {\r\n      return RiskCode.Verify\r\n    }\r\n  }else if asset.Symbol == \"Key\"{\r\n    if cnt > 2  {\r\n      return RiskCode.Verify\r\n    }\r\n  }else if asset.Symbol == \"Miner\"{\r\n    if cnt > 2  {\r\n      return RiskCode.Verify\r\n    }\r\n  }else if asset.Symbol == \"Equipment\"{\r\n    if cnt > 2  {\r\n      return RiskCode.Verify\r\n    }\r\n  }else if asset.Symbol == \"Fashion\"{\r\n    if cnt > 2  {\r\n      return RiskCode.Verify\r\n    }\r\n  }else if asset.Symbol == \"WeaponFashion\"{\r\n    if cnt > 2  {\r\n      return RiskCode.Verify\r\n    }\r\n  }else if asset.Symbol == \"Man\"{\r\n    if cnt > 2  {\r\n      return RiskCode.Verify\r\n    }\r\n  }else if asset.Symbol == \"MTB\"{\r\n    if cnt > 2  {\r\n      return RiskCode.Verify\r\n    }\r\n  }else if asset.Symbol == \"RCN\"{\r\n    return RiskCode.Verify\r\n    // if cnt > 2  {\r\n    //   return RiskCode.Verify\r\n    // }\r\n  }else if asset.Symbol == \"Energy Core\"{\r\n    if cnt + asset.Value > 4 {\r\n      return RiskCode.Verify\r\n    }\r\n  }\r\n}\r\n\r\nreturn RiskCode.Pass',100,1,'AssetCnt'),(9,'2024-06-20 16:31:28.060000','2024-07-04 10:47:11.808000','0','swapmarket','forRange i := SignTxs {\r\n  signTx = SignTxs[i]\r\n  /// 9527 swap and market\r\n  if signTx.Target == \"0xFc1a90688e5891CBA41864cF8A91abFAA82d5068\" || \r\n    signTx.Target == \"0x340518BDaE0A15f4e3B47fec2B4668674e0Fb910\" || \r\n    signTx.Target == \"0x9c1CbFE5328DFB1733d59a7652D0A49228c7E12C\" ||\r\n    //// new market\r\n    signTx.Target == \"0x54E20C8A6F9aF4B080965F504B394730E00a684C\" || \r\n    signTx.Target == \"0x9e15a2B9928eb1Dc927458a44202D28482ab0343\" || \r\n    signTx.Target == \"0x39EBF19280ffC200d8E307bb57569aC6A5BfcB1B\" || \r\n    ////other chain\r\n    signTx.Target == \"0xFc1a90688e5891CBA41864cF8A91abFAA82d5068\" || \r\n    signTx.Target == \"0xFc1a90688e5891CBA41864cF8A91abFAA82d5068\" || \r\n    signTx.Target == \"0xFc1a90688e5891CBA41864cF8A91abFAA82d5068\"  {\r\n    return RiskCode.Verify\r\n  }\r\n  return RiskCode.Pass\r\n}',3,1,'swapmarket'),(10,'2024-06-25 16:06:58.176000','2024-06-25 16:07:01.462000','0','other','return RiskCode.Verify',999,0,'other');
